window.bookSummaryJSON = "<p><i>Get ready to curl up with three thrilling romances from Alison Aimes....</i></p> <p><i>Forbidden Warriors in Love</i> is a steamy enemies-to-lovers bundle that includes books six through eight in the Ruthless Warlords series.</p> <p><i>Forbidden Flame: A Dark Fated-Mates Romance, Book 6</i></p> <p><b>He’s out for revenge. She’s out to escape. Neither intends to fall in love.</b></p> <p>His instructions are simple: Do not open the bag.</p> <p>To escape exile and enact revenge, alpha crime boss Magnus Avitus agrees to play the part of errand boy. But when the volatile package he’s been tasked with delivering begins to squirm, he has to take a peek.</p> <p>He never expects to come face-to-face with her. Or to have everything inside him roar “<i>mine</i>”.</p> <p>Her plans are simple: escape the bag.</p> <p>But when omega Amora Rose’s prison is unpacked before she can free herself, she finds herself claimed by a ferocious, scarred Alpha who makes her heart whisper “<i>mine</i>”.</p> <p>Except she has a secret that’s about to send all their simple plans up in flames.</p> <p><i>Princess Claimed: A Dark Fated-Mates Romance, Book 7</i></p> <p><b>She’s on the run. No memory of her name or identity. In need of help. He’s an exiled beast who learned long ago that it was safer to help only himself.</b></p> <p>Until she falls into his arms—literally. His fated mate.</p> <p>Now, he’ll do anything to possess and protect her. And claim her for his own.</p> <p>Except those after her have other plans...but they never counted on him.</p> <p><i>War Prize of the Beast: A Dark Fated-Mates Romance, Book 8</i></p> <p><b>He’s huge. Fierce. An apex predator. She’s tiny. Soft. Prey.</b></p> <p>He’s destined to vanquish, command, kill. She’s doomed to run, hide, die.</p> <p>But when the most feared beast on the planet captures his war prize expecting his usual conquest, he discovers nothing is what it appears.</p> <p>For the first time, defeat might taste sweeter—and steamier—than any victory.</p> <p><i>If </i>he can find a way to hold onto his prize.</p> <p><i>Forbidden Warlords in Love</i> includes three steamy enemies-to-lovers forced-proximity romances with happy ever afters.</p>"; 
